            // markerCluster = new MarkerClusterer(myMap, markers);

            updateVehicleLocations(updatedVehiclePositions);
        }

        initializeMap();


        function updateVehicleLocations(updatedVehiclePositions) {

            for (var i = 0; i < updatedVehiclePositions.length; i++) {
                var vehiclePosition = updatedVehiclePositions[i];
                var direction = parseInt(vehiclePosition.direction);
                markerCount = markerCount + 1;

                if (vehiclePosition.status == 'stop') {
                    var color = '#E30E00';
                    createMarker(vehiclePosition, direction, color, markerCount);
                } else if (vehiclePosition.status == 'driving') {
                    var color = '#24782D';
                    createMarker(vehiclePosition, direction, color, markerCount);
                } else {
                    var color = '#E38800';
                    createMarker(vehiclePosition, direction, color, markerCount);
                }
            }
        }

