        function fetchData() {
            if (loading) return;
            loading = true;

            axios.get('{{ route('vehicles') }}?page=' + page)
                .then(response => {
                    var newData = response.data;

                    // adding marker to the map
                    updateVehicleLocations(newData);

                    // check if it is clustered
                    updateMarkerClustering();

                    // hide markers if the replay route is playing
                    if (isPlaying == true) {
                        hideMarkers();
                    }

                    if (newData.length > 0) {
                        newData.forEach(vdata => {
                            // Create a new li element using the function
                            var li = createVehicleListItem(vdata);

                            // Add a click event listener to the new card
                            li.addEventListener('click', (function(lat, lng) {
                                return function() {
                                    zoomToVehicleLocation(li, lat, lng, vdata.vplatenum, vdata
                                        .imei);
                                };
                            })(vdata.lat, vdata.lng)); // Pass lat and lng values

                            // Append the li to the ul with class 'nav flex-column'
                            var ul = document.querySelector('.nav.flex-column');
                            ul.appendChild(li);
                        });
                        // filter cards base on user preference
                        filterCards();
                        // search vehicles if there is matching data
                        searchVehicles();
                        page++;
                        loading = false;
                    } else {
                        // No more data, stop fetching
                        clearInterval(intervalId);
                        // filter cards base on user preference
                        filterCards();
                        // search vehicles if there is matching data
                        searchVehicles();
                    }
                })
                .catch(error => {
                    console.error(error);
                });
        }

        function fetchDataInterval() {

            axios.get('{{ route('dataInterval') }}')
                .then(response => {
                    var newData = response.data;
                    var newcountData = newData.length;

                    // Clear existing markers
                    markers.forEach(function(marker) {
                        marker.setMap(null);
                    });
                    markers = [];

                    // Remove previous marker/label if exists
                    if (currentMarker) {
                        currentMarker.setMap(null);
                    }
                    // update markers on the map
                    updateVehicleLocations(newData);

                    // check if it is clustered
                    updateMarkerClustering();

                    // hide markers if the replay route is playing
                    if (isPlaying == true) {
                        hideMarkers();
                    }

                    if (newData.length > 0) {
                        var ulElements = document.getElementById("vehicleList");
                        var liElements = ulElements.getElementsByClassName('nav-item');


                        let i = 0;
                        newData.forEach(vdata => {
                            var liElement = liElements[i];

                            // Update the content within the card
                            // img update
                            var imgDiv = liElement.querySelector('.col-md-6');
                            var imageSrc = '';

                            var imagePath = vdata.imagesrc ? vdata.imagesrc : 'images/img.png';
                            imageSrc = imagePath;
                            imgDiv.innerHTML =
                                `<img class="carImg" src="${imageSrc}" alt="image">`;

                            var textDiv = liElement.querySelector('.textDiv');
                            // vplate update
                            textDiv.querySelector('.vplatenum').textContent = vdata.vplatenum;

                            var statusDiv = textDiv.children[1];

                            // status update
                            if (vdata.status == 'driving') {
                                statusDiv.className = 'vStatDriving';
                                statusDiv.textContent = 'DRIVING';
                            } else if (vdata.status == 'idle') {
                                statusDiv.className = 'vStatIdling';
                                statusDiv.textContent = 'IDLING';
                            } else {
                                statusDiv.className = 'vStatStop';
                                statusDiv.textContent = 'STOP';
                            }

                            // last report update
                            textDiv.querySelector('.lastReport').textContent = fordate(vdata.gps_date);

                            // grab the addressDiv
                            var addressDiv = liElement.querySelector('.addressDiv');

                            // update the address
                            addressDiv.querySelector('.address').textContent = vdata.address;

                            // update also the lat and lng data when updating the lists
                            (function(vdata) {
                                liElement.addEventListener('click', function() {
                                    zoomToVehicleLocation(liElement, vdata.lat, vdata.lng, vdata
                                        .vplatenum, vdata.imei);

                                });
                            })(vdata);
