        function zoomToVehicleLocation(liElement, lat, lng, vplatenum, vehicleData) {

            var newLatLng = new google.maps.LatLng(lat, lng);
            myMap.setCenter(newLatLng);
            myMap.setZoom(20); // You can adjust the zoom level as needed

            // Remove previous marker/label if exists
            if (currentMarker) {
                currentMarker.setMap(null);
            }

            // Add label to the marker
            currentMarker = new google.maps.Marker({
                position: newLatLng,
                map: myMap,
                label: {
                    text: vplatenum,
                    className: "marker-label"
                },
                icon: {
                    path: google.maps.SymbolPath.BACKWARD_CLOSED_ARROW,
                    scale: 0,
                },
            });
            // Remove "active" class from all other <li> elements
            const allLiElements = document.querySelectorAll(".nav-item");
            allLiElements.forEach((element) => {
                element.classList.remove("active");
            });

            // Add "active" class to the clicked <li> element
            liElement.classList.add("active");

            // call function to show showDetails div but no dates
            showDetails(vehicleData, start, end);;
        }

