        ///////////////////////////////////////////////////////// 

        function getMarkerImage(index) {
            var vehicleStatus = dataImei[index][3]; // get the vehicles status

            if (vehicleStatus == 'stop') {
                return 'images/sedan_stopped.svg';
                // return '#E30E00';
            } else if (vehicleStatus == 'driving') {
                return 'images/sedan_driving.svg';
                // return '#24782D';
            } else {
                return 'images/sedan_idle.svg';
                // return '#E38800';
            }
        }

        function getColorOfMarker(index) {
            var vehicleStatus = dataImei[index][3]; // get the vehicles status

            if (vehicleStatus == 'stop') {
                return '#E30E00';
            } else if (vehicleStatus == 'driving') {
                return '#24782D';
            } else {
                return '#E38800';
            }
        }

        function getDirectionOfVehicle(index) {
            var direction = dataImei[index][6] + 180;
            return direction;
        }

        function getDateAndTime(index) {
            var dateAndTime = dataImei[index][4];
            return dateAndTime;
        }

