        const fastForwardButton = document.getElementById('fastForwardButton');

        function updateProgressBar(position) {
            let percent = (position / progressBar.offsetWidth) * 100;
            let step = Math.round((percent / 100) * totalSteps);
            progress.style.width = (step / totalSteps) * 100 + '%';
            currentStep = step;
        }

