        // Update the content of the info window with the marker's current position
        function updateInfoWindowContent() {
            infowindow.setContent("Latitude: " + movingMarker.getPosition().lat() + "<br>Longitude: " + movingMarker
                .getPosition().lng() + "<br>Date and Time: " + movingMarker['dateAndTime']);
        }

        function togglePlay() {

            // Remove previous markers if they exist
            if (markerRoutes) { // Check if markerRoutes is defined and not null
                for (var i = 0; i < markerRoutes.length; i++) {
                    if (markerRoutes[i]) { // Check if marker exists at index i
                        markerRoutes[i].setMap(null); // Remove marker from map
                    }
                }
                markerRoutes = []; // Clear the array
            }

            // Clear previous polyline if it exists
            // if (flightPath) {
            //     flightPath.setMap(null); // Remove polyline from map
            // }

            var latlngbounds = new google.maps.LatLngBounds();

            //Extend the bounds to include all points of the polyline
            for (var i = 0; i < flightPlanCoordinates.length; i++) {
                latlngbounds.extend(flightPlanCoordinates[i]);
            }

            //Adjust map to show all polyline points
            myMap.fitBounds(latlngbounds);

            // Add a click event listener to the marker to open the info window
            movingMarker.addListener('click', function() {
                updateInfoWindowContent();
                infowindow.open(myMap, movingMarker);
            });

            // Call the function to update the content initially
            updateInfoWindowContent();

            // Open the info window on the map with the marker
            infowindow.open(myMap, movingMarker);

            function moveMarker() {
                // set marker options
                markerOptions(currentStep);
                // setting marker position on map
                movingMarker.setPosition(flightPlanCoordinates[currentStep]);
                updateInfoWindowContent();
            }

            ///////////////// Progress Bar /////////////////////////

            var numberOfPoints = flightPlanCoordinates.length;
            totalSteps = numberOfPoints - 1;

            progressBar.addEventListener('mousedown', function(event) {
                isDragging = true;
                moveProgressBar(event);
                moveMarker();
            });

            document.addEventListener('mousemove', function(event) {
                if (isDragging) {
                    moveProgressBar(event);
                    moveMarker();
                }
            });

            document.addEventListener('mouseup', function() {
                if (isDragging) {
                    isDragging = false;
                }
            });

            function moveProgressBar(event) {
                let rect = progressBar.getBoundingClientRect();
                let clickX = event.clientX - rect.left;
                let newPosition = Math.max(0, Math.min(clickX, progressBar.offsetWidth));
                updateProgressBar(newPosition);
            }

            if (isPlaying) {
                clearInterval(interval);
                isPlaying = false;
                playBtn.textContent = 'Play';
            } else {
                ///////// hide markers
                hideMarkers();
                isPlaying = true;
                if (currentStep >= totalSteps) {
                    currentStep = 0;
                    progress.style.width = '0%';
                    //setting marker options
                    markerOptions(currentStep);
                    updateInfoWindowContent();
                }
                // call function to play the replay
                startReplayInterval();
                playBtn.textContent = 'Stop';
            }
        }

        var replaySpeed = 500;

        function startReplayInterval() {
            clearInterval(interval);
            interval = setInterval(function() {
                if (currentStep >= totalSteps || !isPlaying) {
                    clearInterval(interval);
                    isPlaying = false;
                    playBtn.textContent = 'Play';
                } else {
                    currentStep++;
                    updateProgressBar((currentStep / totalSteps) * progressBar.offsetWidth);

                    // to move the marker
                    // movingMarker.setPosition(flightPlanCoordinates[currentStep]);
                    // setting marker options
                    markerOptions(currentStep);
                    updateInfoWindowContent();
                }
            }, replaySpeed);
        }

        function slowingDown() {
            if (replaySpeed < 800) {
                replaySpeed += 100;
                startReplayInterval();
            }
        }

        function fastForward() {
            if (replaySpeed > 200) {
                replaySpeed -= 100;
                startReplayInterval();
            }
        }

        function formatDuration(duration) {
            var hours = Math.floor(duration / 3600);
            var minutes = Math.floor((duration % 3600) / 60);
            var seconds = duration % 60;

            var result = '';

            result += hours > 1 ? hours + ' hrs, ' : hours + ' hr, ';
            result += minutes > 1 ? minutes + ' mins, ' : minutes + ' min, ';
            result += seconds > 1 ? seconds + ' secs, ' : seconds + ' sec, ';

            return result;
        }

