        function fordate(date) {
            const periods = ["second", "minute", "hour", "day", "week", "month", "year", "decade"];
            const lengths = [60, 60, 24, 7, 4.35, 12, 10];

            const dateNow = Date.now() / 1000;
            const unixDate = Date.parse(date) / 1000;

            let difference, tense;
            let j = 0;

            if (dateNow > unixDate) {
                difference = dateNow - unixDate;
                tense = "ago";
            } else {
                difference = unixDate - dateNow;
                tense = "from now";
            }

            while (difference >= lengths[j] && j < lengths.length - 1) {
                difference /= lengths[j];
                j++;
            }

            difference = Math.round(difference);

            if (difference !== 1) {
                periods[j] += "s";
            }

            return `${difference} ${periods[j]} ${tense}`;
        }

