        var polygons = [];

        function getGeofence() {
            const showPolygonsCheckbox = document.getElementById('geofence');
            const isChecked = showPolygonsCheckbox.checked;
            axios.get('{{ route('geofence') }}')
                .then(response => {
                    const geofenceData = response.data;

                    // Clear existing polygons
                    polygons.forEach(polygon => polygon.setMap(null));
                    polygons.length = 0;

                    geofenceData.forEach(gdata => {
                        const coordinatesListPolygon = gdata.coords.split(',').map(pair => {
                            const [lat, lng] = pair.split(' ').map(parseFloat);
                            return {
                                lat,
                                lng
                            };
                        });

                        const polygon = new google.maps.Polygon({
                            paths: coordinatesListPolygon,
                            strokeColor: gdata.color,
                            strokeOpacity: 0.8,
                            strokeWeight: 2,
                            fillColor: gdata.color,
                            fillOpacity: 0.35,
                            map: isChecked ? myMap : null,
                        });

                        polygons.push(polygon);
                    });
                })
                .catch(error => {
                    console.error(error);
                });
        }
